import React from "react";
import "./Footer.css";
import "./HorizontalneListe.css";
import HorizontalnaLista from "./HorizontalneListe";
import Ikona from "./Ikonica.js";
import "./Ikonica.css";
import "./LargeButton";
import face from "./fb.png";
import twit from "./twitter.png";
import part from "./web.png";
import LargeButton from "./LargeButton";

function Footer(){
    const fb = {
        src: face,
        alt: "facebook"
    }
    const twitter = {
        src: twit,
        alt: "twitter"
    }
    const partners = {
        src: part,
        alt: "partners"
    }
    return(
            <footer style="--visina:60px">
                <div className="tekst">
                    <HorizontalnaLista 
                        prvi={<LargeButton value="ABOUT"/>}
                        drugi={<LargeButton value="TEAM"/>}
                        treci={<LargeButton value="CONTACT"/>}
                    />
                </div>
                <div className="ikone">
                     <HorizontalnaLista 
                        prvi={<Ikona url={fb.src} alt={fb.alt}/>} 
                        drugi={<Ikona url={twitter.src} alt={twitter.alt}/>}
                        treci={<Ikona url={partners.src} alt={partners.alt}/>}
                        />
                </div>
            </footer>
    );
}

export default Footer;
